void PrototypeSchedulerProcessor::write(int amountFlp2, duration<double>dur) {
	std::ofstream gnudatafile("gnudatafile.txt", std::ios_base::out | std::ios_base::app );
	gnudatafile << amountFlp2 << "\t" << dur.count() << std::endl;
	return;
}
void PrototypeSchedulerProcessor::write(std::string msgSize2, duration<double>dur) {
	std::ofstream gnudatafile("gnudatafile.txt", std::ios_base::out | std::ios_base::app );
	gnudatafile << msgSize2 << "\t" << dur.count() << std::endl;
	return;
}

